import React, { Component } from 'react'

export class SubscribeBtn extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <div>
                <button>Subscribe</button>
            </div>
        )
    }
}

export default SubscribeBtn
